PnP React Hooks is a wrapper library for PnPjs , provides configurable React hooks for SharePoint API to speed up development for simple SPFx webparts and components. Example usage: import * as React from "react";
import { useListItems, useCurrentUser } from "pnp-react-hooks"; export const ExampleComponent = () => { const currentUser = useCurrentUser(); const items = useListItems("My List", { query: { select: ["Title", "Id", "Author/Title"], expand: ["Author"], filter: `Author eq ${currentUser?.Id}` }, disabled: !currentUser }); return (<ul> {items?.map(item => (<li key={item.Id}>{item.Title}</li>))} </ul>);
};

